              fermentum, nunc massa gravida lectus, quis feugiat nisl justo vel
              sem.
            </p>

          </div>
          <Buttons {...{ whichStep, setWhichStep }} />
          <Inputs
            {...{
              whichStep,
              setWhichStep,
              customerInputs,
            }}
          />
        </div>
      </div>
    </section>
  );
};

export default Step7;
